import React from 'react';

const TitlePagination: React.FC = () => {
  const styles = {
    dot: {
      cursor: 'pointer',
      height: '15px',
      width: '15px',
      margin: '0 2vh',
      backgroundColor: '#bbb',
      borderRadius: '50%',
      display: 'inline-block',
      transition: 'backgroundColor 0.6s ease',
    },
  };
  return (
    <span style={styles.dot}></span>
  );
};

export default TitlePagination;
